import React from 'react';
import Header from '../Header/Header';
import Login from '../Login/Login';
import Modal from '../Modal/Modal';

function HeaderSection() {
	return (
		<div>
			<Header />

			<Modal>
				<Login />
			</Modal>
		</div>
	);
}

export default HeaderSection;
